import React, {Component} from 'react';

class Photo extends Component {
    render(){
      return(
        <div key={this.props.id}>
          <figure>
            <image src = {this.props.imageLink}></image>
          </figure>
          <figcaption>
            <h4>{this.props.description}</h4>
          </figcaption>
        </div>
      );
    }
  }

export default Photo;
